import {
    Form,
    Select,
    InputNumber,
    DatePicker,
    Switch,
    Slider,
    Button,
    Input
  } from "antd";
  import Link from "next/link";
  import { useDispatch,useSelector } from 'react-redux'
import { useEffect } from "react";
import { fetchposts,updateSsid,updateBird,updatePost } from '../../store/actions/postAction'
  
  const FormItem = Form.Item;
  
  function selectData() {
    const {Name,} = useSelector(state=>state.post)
    const dispatch = useDispatch();
    useEffect(()=>{
      //dispatch(fetchposts("BAS"))
      console.log(Name)
    })
    return (
      <div style={{ marginTop: 0,width:"100%",maxWidth:"480px"}}>
        <FormItem>
          <div className="nu-font-covid">
            <div>
              Picture
              <form>
                <h3 style={{ color: "white",fontSize:"18px" }}>ชื่อ สกุล</h3>
                <Input
                  style={{height:"62px",borderRadius:"31px",fontSize:"22px",padding:"0px 25px"}}
                  placeholder="ชื่อ สกุล"
                  type="text"
                  value={Name}
                  onChange={(e) => dispatch(fetchposts(e.target.value))}
                />
                <h3 style={{ color: "white",fontSize:"18px" }}>หมายเลขประจำตัวประชาชน</h3>
                <Input
                style={{height:"62px",borderRadius:"31px",fontSize:"22px",padding:"0px 25px"}}
                  placeholder="หมายเลขประจำตัวประชาชน"
                  type="text"
                  /*value={SSID}
                  onChange={(e) => updateSSID(e.target.value)}*/
                  required
                />
                <h3 style={{ color: "white",fontSize:"18px" }}>วัน เดือน ปีเกิด</h3>
                <DatePicker
                  style={{
                    width: "100%",
                    justifyContent: "flex-end",
                    alignItems: "center",
                    display: "flex",
                    height:"62px",
                    borderRadius:"31px",
                    padding:"0px 25px",
                    fontSize:"22px"
                  }}
                  /*onChange={handleChange}*/
                  required
                />
                <h3 style={{ color: "white",fontSize:"18px" }}>รหัสไปรษณีย์</h3>
                <Input
                style={{height:"62px",borderRadius:"31px",fontSize:"22px",padding:"0px 25px"}}
                  placeholder="รหัสไปรษณีย์"
                  type="text"
                  /*value={PostId}
                  onChange={(e) => updatePostId(e.target.value)}*/
                  required
                />
              </form>
            </div>
          </div>
        </FormItem>
      </div>
    );
  }
  
  export default selectData;
